import React from 'react';

export default function StudentExam() {
  return (
    <div style={{ marginLeft: '51px', marginRight: '127px', marginTop: '28px', marginBottom: '71px' }}>
      <p style={{ fontfamily: 'Roboto', fontStyle: 'normal', fontWeight: 'normal', fontSize: '18px', lineHeight: '21px', color: '#4D4D4D' }}>Home <b>> <u>Exam</u></b></p>
      <div style={{ marginTop: '81px' }}>
        <div style={{ height: '102px', width: '100%', background: '#FDFDFD', border: '2px solid #A4A4A4', borderRadius: '5px', textAlign: 'center' }}>
          <p style={{ paddingLeft: '64px', fontFamily: 'Rubik', fontStyle: 'normal', fontWeight: '500', fontSize: '24px', lineHeight: '28px', color: '#646464' }}>Exam</p>
          <p style={{ float: 'right', paddingLeft: '64px', fontFamily: 'Rubik', fontStyle: 'normal', fontWeight: '500', fontSize: '24px', lineHeight: '28px', color: '#646464' }}>></p>
        </div>

      </div>
    </div>
  );
}
